import React from 'react';
import { BrowserRouter, Routes, Route} from 'react-router-dom';
import SignIn from './pages/signin';
import SignUp from './pages/signup';
import Home from './pages/home';
import Scholarships from './pages/scholarships';
import CreateNewScholarship from './pages/createNewScholarship';
import AppMatch from './pages/appmatch';
import Application from './pages/application';
import Users from './pages/users';
import ViewScholarship from './pages/viewsholarship';
import { Switch } from 'react-router-dom';

const AppRoutes: React.FC = () => {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/signin" element={<SignIn />} />
                <Route path="/signup" element={<SignUp />} />
                <Route path="/matches" element={<AppMatch />} />
                <Route path="/application" element={<Application />} />
                <Route path="/home" element={<Home />} />
                {/* <Route path="/scholarships" element={<Scholarships />} /> */}

                <Switch>
                    <Route path="/" component={Scholarships} />
                    <Route path="/view-scholarship/:id" component={ViewScholarship} />
                </Switch>
                <Route path="/users" element={<Users />} />
                <Route path="/createscholarship" element={<CreateNewScholarship />} />

            </Routes>
        </BrowserRouter>
    );
};

export default AppRoutes;
